/**
   * Is this a GETPROP or GETELEM node?
   */

code:
static boolean isGet(Node n) {
    return n.isGetProp() || n.isGetElem();
  }

private JSType getJSType(Node n) {
    JSType jsType = n.getJSType();
    if (jsType == null) {
      return unknownType;
    } else {
      return jsType;
    }
  }

